df.rename(columns={'date': 'Timestamp'}, inplace=True)

# Function to detect outliers
def detect_outliers(df, column, threshold=3):
    mean = df[column].mean()
    std_dev = df[column].std()
    df['Std_Dev'] = std_dev
    df['Outlier'] = np.abs(df[column] - mean) > threshold * std_dev
    return df

# Detect outliers in the 'close' column
df = detect_outliers(df, 'close')

# Plotting the data
def plot_outliers(df, column):
    plt.figure(figsize=(12, 6))
    plt.plot(df['Timestamp'], df[column], label='Not suspicious', color='blue')
    
    outliers = df[df['Outlier']]
    plt.scatter(outliers['Timestamp'], outliers[column], color='red', label='Suspicious', edgecolor='black', zorder=5)
    
    plt.xlabel('Date')
    plt.ylabel('Close Price')
    plt.title('Outlier Detection in Close Price Data')
    plt.legend()
    plt.show()

plot_outliers(df, 'close')